import web2 from "../src/images/img5.jpg";
import web3 from "../src/images/img6.jpg";
import web4 from "../src/images/img7.jpg";
import web5 from "../src/images/img8.jpg";

const  Sdata =[
    {
        img:web,
        title : "Web Developer",
    },
    {
        img:web1,
        title : "App Developer",
    },
    {
        img:web2,
        title : "Digital Marketing",
    },
    {
        img:web3,
        title : "Android Developer",
    },
    {
        img:web4,
        title : "Marketing",
    },
    {
        img:web5,
        title : "Software Developer",
    }    
];
export default Sdata;
